from PIL import Image
import io

def pdf_page_to_pil_image(page):
    """
    Converts a PyPDF2 page object to a PIL Image object
    """
    # Convert the PyPDF2 page to a PNG image
    png_image = io.BytesIO()
    page.write_png(png_image)
    
    # Create a PIL Image object from the PNG image data
    pil_image = Image.open(png_image)
    
    return pil_image

